import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { StateProvider } from './context/StateContext';

import ActionPanel from './components/ActionPanel';
import OutputPanel from './components/OutputPanel';
import CodePanel from './components/CodePanel';
import MessagePanel from './components/MessagePanel';
import NormalizedTableView from './components/NormalizedTableView';
import ERDiagramPage from './components/ERDiagramPage';
import './style.css';
import '@fortawesome/fontawesome-free/css/all.min.css';

const MainLayout = () => (
  <div className="app-container" style={{display: 'flex', height: '100vh'}}>
    <div className="left-panel" style={{flex: '0 0 20%', borderRight: '1px solid #ccc'}}>
      <ActionPanel />
    </div>
    <div className="center-panel" style={{flex: '1', borderRight: '1px solid #ccc'}}>
      <OutputPanel />
    </div>
    <div className="right-panel" style={{flex: '0 0 20%', display: 'flex', flexDirection: 'column'}}>
      <div className="message-panel" style={{flex: '0 0 30%', overflowY: 'auto'}}>
        <MessagePanel />
      </div>
      <div className="code-panel" style={{flex: '1', overflowY: 'auto'}}>
        <CodePanel />
      </div>
    </div>
  </div>
);

const App = () => {
  return (
    <StateProvider>
      <Router>
        <Routes>
          <Route path="/" element={<MainLayout />} />
          <Route path="/table-view" element={<NormalizedTableView />} />
          <Route path="/er-diagram" element={<ERDiagramPage />} />
        </Routes>
      </Router>
    </StateProvider>
  );
};

export default App;
